import { initializeApp } from "firebase/app";

const firebaseConfig = {
  apiKey: process.REACT_APP_API_KEY,
  authDomain: "nwitter-aff98.firebaseapp.com",
  projectId: "nwitter-aff98",
  storageBucket: "nwitter-aff98.appspot.com",
  messagingSenderId: "99569680427",
  appId: "1:99569680427:web:e0ff04570798f30ef7aa6e"
};


const app = initializeApp(firebaseConfig);

export default app;
